import React from 'react'
import { auth } from '../firebase/firebase-config'
import { signOut } from 'firebase/auth'
import { useNavigate } from 'react-router-dom'

const Home = () => {
  const navigate = useNavigate()

  const handleLogout = async () => {
    try {
      await signOut(auth)
      navigate('/login')
    } catch (error) {
      console.error('Error logging out:', error)
    }
  }

  return (
    <div className="min-h-screen flex items-center justify-center bg-[#132657]">
      <div className="max-w-md w-full space-y-8 p-10 bg-white/5 backdrop-blur-lg rounded-xl shadow-2xl border border-white/10">
        <div className="space-y-4">
          <h2 className="text-center text-4xl font-bold text-white tracking-tight">Dashboard</h2>
          <p className="text-center text-gray-300 text-sm">Welcome to your dashboard</p>
        </div>
        <div className="space-y-6 mt-8">
          <div className="p-6 bg-white/5 border border-white/10 rounded-lg">
            <h3 className="text-xl font-semibold text-white mb-4">Your Profile</h3>
            <p className="text-gray-300">Welcome to your personal dashboard. This is where you can manage your account and view your information.</p>
          </div>
          <button
            onClick={handleLogout}
            className="w-full py-3 px-4 bg-blue-600 text-white rounded-lg font-medium hover:bg-blue-700 focus:outline-none focus:ring-2 focus:ring-blue-500 focus:ring-offset-2 focus:ring-offset-[#132657] transition-all duration-200 shadow-lg shadow-blue-500/20"
          >
            Sign Out
          </button>
        </div>
      </div>
    </div>
  )
}

export default Home
